import React from 'react';
import Wheel from './wheel.js';

const WheelOfFortune = (props) => {
  return(
    <div>
      <Wheel winnerNumber={props.winnerNumber} generateWinner={props.generateWinner} participants={props.participants} />
    </div>
  )
}

export default WheelOfFortune;
